import React from "react";
import styles from "./SideBar.module.css";
import { NavLink } from "react-router-dom";

const SideBar = () => {
  return (
    <div className="styles.sideBar">
      <ul>
        <li>
          <NavLink> DashBoard</NavLink>
        </li>
        <li>Your Profile</li>
        <li>Settings</li>
      </ul>
    </div>
  );
};

export default SideBar;
